MongoDB query fast in mongo shell but slow/times out in nodejs<p>The following query takes approximately 54ms in the mongo shell, but times out after a minute in the nodejs driver:</p>
<pre><code>db.posts.find(
  {
    parentId: 10,
    modifiedGmt: {
      &quot;$gte&quot;: new Date(&quot;2017-01-01T00:00:00.000z&quot;)
    },
    postType: {
      &quot;$in&quot;: [&quot;type1&quot;, &quot;type2&quot;]
    }
  },
  {
    _id: 1,
    parentId: 1,
    postId: 1,
    url: 1,
    modifiedGmt: 1,
    authors: 1,
    taxonomy: 1,
    postType: 1
  }
).sort({modifiedGmt: 1}).limit(2400)
</code></pre>
<p>Explain shows that the query is using existing indexes. If I drop the limit to something very low like 10, it won't time out but it will take far, far too long. I'm not really sure where to go with this. It's a large collection but with the indexes in place and the limit sub-10000 I don't see why it would be so slow.</p>
<p>Any ideas?</p>

