How to replace one document with WebFlux and MongoDB Reactive frameworks?<p>I have an old project that I would like to modernize using WebFlux and MongoDB Reactive frameworks but I'm absolutely stuck at the update method. I have no clue what to pass in the subscribe method. The replaceOne call returns a Publisher but how I should handle it? One of the tips I read was about using the SubscriberHelpers class from mongo-java-driver-reactivestreams but it's missing from the recent versions (4.4). Any help would be appreciated.</p>
<pre><code>mongoDatabase.getCollection(&quot;players&quot;, Player.class).replaceOne(
    Filters.eq(&quot;email&quot;, player.getEmail()),
    player,
    new ReplaceOptions().upsert(true)
).subscribe( ??? );
</code></pre>
<p>Update: I created a DummySubscriber class to manage the subscription which seems working properly.</p>
<pre><code>mongoDatabase.getCollection(&quot;players&quot;, Player.class).replaceOne(
    Filters.eq(&quot;email&quot;, player.getEmail()),
    player,
    new ReplaceOptions().upsert(true)
).subscribe(new DummySubscriber&lt;&gt;());

private static class DummySubscriber&lt;T&gt; implements Subscriber&lt;T&gt; {
    @Override
    public void onSubscribe(Subscription subscription) {
        subscription.request(Integer.MAX_VALUE);
    }

    @Override
    public void onNext(T t) {
    }

    @Override
    public void onError(Throwable throwable) {
        System.out.println(&quot;Error while updating data&quot;);
    }

    @Override
    public void onComplete() {
        System.out.println(&quot;Data has been updated&quot;);
    }
}
</code></pre>

