AggregateOption MongoDB how to iterate C# Mongodb.Driver<p>I am turning my List of an MongoDb aggregation pipeline to a BatchSize operation but I am unsure how to loop through the batches it after creating an option of BatchSize of 100000.  I could have 800K in the list or I could have 64M.</p>
<p>I have the options as:</p>
<pre><code>//Batch size
AggregateOptions aggOptions = new AggregateOptions();
aggOptions.BatchSize = 100000;
</code></pre>
<p>My pipeline is such as:</p>
<pre><code> var sample = (entityCollection.Aggregate(aggOptions)
                       .Match(dateFilterString)
                       .Project(projectString));
</code></pre>
<p>And what I have is:</p>
<pre><code>await sample.ForEachAsync(doc =&gt;
 {
    var test = doc.ToList();

    Console.WriteLine(&quot;### Count ###: &quot; + test.Count());

  }
);

</code></pre>
<p>I do not want to iterate one by one in each batch but want to apply a if batch exists MoveNextAsync or hasNext() and apply something like this 8 times, is it possible? Or is the Select statement doing the same thing and doing a loop?  What is most efficient?</p>
<pre><code>var keys = (entityCollection.Aggregate()
    .Match(dateFilterString)
    .Project(projectString)
    .Limit(100000)
    .ToList())
 .Select(x =&gt; (x[2][0].ToString().Substring(15, 32))).ToArray();
</code></pre>

