React Router: props aren't passed down when directly accessing the URL of child component. Will I need to use the same state in both parent and child?<p>I'm pretty new to React and React Router so apologies if this is a silly question or answered elsewhere - I did a search but couldn't find a similar question.</p>
<p>I'm using React Router v6 and React Hooks. My very basic full-stack app is focused on keeping track of musical artists and their released projects (albums, mixtapes, EPs, etc.). My App component will render the ProjectList component at the <code>'/'</code> route, and the ArtistList component at the <code>'/artists'</code> route.</p>
<p>Relevant portions of App.js:</p>
<pre><code>import React, { useState, useEffect } from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import axios from 'axios';

import ProjectList from './ProjectList';
import ArtistList from './ArtistList';

import { Button } from './styles.js';

const App = () =&gt; {
  const [ projects, setProjects ] = useState([]);

  const getProjects = () =&gt; axios('projects').then(({ data }) =&gt; setProjects(data));
  useEffect(getProjects, []);

  return (&lt;&gt;
    &lt;Link to=&quot;/&quot;&gt;
      &lt;Button&gt;Projects&lt;/Button&gt; // Button is using styled-components
    &lt;/Link&gt;
    &lt;Link to=&quot;/artists&quot;&gt;
      &lt;Button&gt;Artists&lt;/Button&gt;
    &lt;/Link&gt;
    &lt;Routes&gt;
      &lt;Route path=&quot;/&quot; element={&lt;ProjectList projects={projects} /&gt;} /&gt;
      &lt;Route path=&quot;/artists&quot; element={&lt;ArtistList projects={projects} /&gt;} /&gt;
    &lt;/Routes&gt;
  &lt;/&gt;);
};
</code></pre>
<p>This all works as expected when I click the Projects and Artists buttons. However, when I attempt to access the <code>'/artists'</code> route directly through the URL bar of my browser, nothing renders and I get an error about how the <code>projects</code> prop is undefined. My assumption is that because I'm trying to access the ArtistList component before rendering the App component itself, <code>getProjects</code> doesn't run and so no <code>projects</code> props are passed down to ArtistList.</p>
<p>I need the list of <code>projects</code> to render my ArtistList component. Each element of <code>projects</code> is an object that includes an <code>artist</code> property that I use to create my list of artist names and a <code>dateAdded</code> property that I use to sort the artist list by recency. I also keep track of how many projects each artist has.</p>
<p>Relevant portions of ArtistList.jsx (the <code>return</code> block contains some <code>styled-components</code> - Options, Header, TextWrapper, and Artist):</p>
<pre><code>const ArtistList = ({ projects }) =&gt; {
  const [ artists, setArtists ] = useState([]);
  const [ sortBy, setSortBy ] = useState('name');

  const getArtists = () =&gt; {
    const artists = [];
    let curArtist = projects[0].artist;
    let projectCount = 0;
    const now = new Date();
    let firstAdded = now;

    for (const { artist, dateAdded } of projects) {
      if (artist !== curArtist) {
        artists.push({ name: curArtist, projectCount, firstAdded });
        curArtist = artist;
        projectCount = 0;
        firstAdded = now;
      }
      projectCount++;
      const projectDate = new Date(dateAdded);
      if (projectDate &lt; firstAdded)
        firstAdded = projectDate;
    }
    setArtists(artists);
  };
  useEffect(getArtists, [ projects, sortBy ]);

  if (sortBy === 'number')
    artists.sort((a, b) =&gt; b.projectCount - a.projectCount);
  else if (sortBy === 'recency')
    artists.sort((a, b) =&gt; b.firstAdded - a.firstAdded);

  return (&lt;&gt;
    &lt;Options&gt;
      &lt;label htmlFor=&quot;sortBy&quot;&gt;Sort by: &lt;/label&gt;
      &lt;select id=&quot;sortBy&quot; value={sortBy} onChange={e =&gt; setSortBy(e.target.value)}&gt;
        &lt;option value=&quot;artist&quot;&gt;Name&lt;/option&gt;
        &lt;option value=&quot;number&quot;&gt;# of Projects&lt;/option&gt;
        &lt;option value=&quot;recency&quot;&gt;Recently Added&lt;/option&gt;
      &lt;/select&gt;
    &lt;/Options&gt;
    &lt;Header&gt;
      &lt;TextWrapper&gt;Name&lt;/TextWrapper&gt;
      &lt;TextWrapper&gt;# of Projects&lt;/TextWrapper&gt;
    &lt;/Header&gt;
    {artists.map(({ name, projectCount }, idx) =&gt; (
      &lt;Artist key={idx}&gt;
        &lt;TextWrapper&gt;{name}&lt;/TextWrapper&gt;
        &lt;TextWrapper&gt;{projectCount}&lt;/TextWrapper&gt;
      &lt;/Artist&gt;
    ))}
  &lt;/&gt;);
};
</code></pre>
<p>I currently see 2 solutions to this issue (I'm sure I'm missing more):</p>
<ol>
<li><p>Create a <code>projects</code> state and a <code>getProjects</code> in the ArtistList component, pretty much exactly as they are in the parent App component. Whenever I render ArtistList, I will make a request to my back end to retrieve a list of projects and then invoke <code>setProjects</code>. I'd then derive the <code>artists</code> state from <code>projects</code>, as before. Of course, I'd no longer need to pass the <code>projects</code> props from App to ArtistList. However, I would then have the exact same state values/functionality in both parent and child components, and this feels to me like a violation of fundamental React principles.</p>
</li>
<li><p>Put a collection of Artists into my Mongo database, in addition to the Projects collection I currently have. I would have to implement something similar to the <code>getArtists</code> function, but in the back end this time, then put the list of artist data into my database. Then, every time I try to render ArtistList, I will make a request to my back end to retrieve the list of artists and go from there.</p>
</li>
</ol>
<p>The third option is doing nothing, but then I'm unable to access the <code>'/artists'</code> page directly through the URL.</p>
<p>What would be best practice and the best approach in this instance? Any help is appreciated!</p>

