image won't upload correctly in web browser from mongodb database<p>I managed to store some user info in mongodb database. When I tried to retrieve it and display it in the browser all fields are correct except the image file. The image is type Object in database and has 2 fields: data : Binary('..... and contentType : &quot;image/png&quot;. When I tried to convert it in the ejs file the browser shows broken image icon. I also inspected the page and I found this error: &quot;Failed to load resource: net :: ERR_INVALID_URL data:users[i]/image/png;base64,%OA [object Object]&quot;; what should I change so image is loaded correctly?</p>
