How to test change unit in mongock with its multiple attributes/lifecycle methods?<p>We recently migrated from MongoBee to Mongock, and with Mongock 5 version the <code>@ChangeLog</code> and <code>@ChangeSet</code> are depricated. Writing the <code>@ChangeUnit</code> is easy enough and rollback methods are very helpful.</p>
<p>However, I'm unable to figure out how to write a test simulating the migration in test DB and validating the changes in DB, as there are <code>@BeforeExecution</code>, <code>@RollbackBeforeExecution</code>, <code>@Execution</code> and <code>@RollbackExecution</code> attributes or lifecycle methods in a @ChangeUnit.</p>
<p>Earlier, I used to just call the method with <code>@ChangeSet</code> annotation like</p>
<pre><code>assertOriginalStructure();
someMigrationChangeLog.updateIndexOnSomething();
assertIndexUpdated();
</code></pre>
<p>Now, I'm unsure if there is a clean way to write the above test as there is some logic in <code>@BeforeExecution</code> and also in <code>@Execution</code>. I know individually calling the annotated methods will work, but I wanted to know if there is a way to just run one <code>@ChangeUnit</code> as a whole.</p>

